import React, { Fragment } from 'react'
import {  NavLink } from 'react-router-dom';

class Main extends React.Component{
  render(){
      return(
        <Fragment>

      <div className="mainContainer">
        <div className="sidenav">
          <a href="#about">About</a>
          <NavLink to='/favorites' exact>Favorites</NavLink>
          {/* <img className="flameButton" src='./imgage.gif' alt="Snow"/> */}
        </div>

        <div className="backgroundMain" id='buttonImage'>
         <span></span>
          <button className="btn btn-dark characterMain"><NavLink to='/characters' exact>Wizards</NavLink></button>
        </div>
        <div className="backgroundMain" id='buttonImage'>
         <span></span>
          <button className="btn btn-dark spellMain"><NavLink to='/spells' exact> &nbsp;Spells  </NavLink></button>
        </div>
      </div>
      </Fragment>
      )

  }
}

export default Main
